const Home = () => {
  return (
    <div>
      <h2>Welcome to the Game Room</h2>
      <p>
        We hope you enjoy our selection of games to play from the list on the
        left.
      </p>
      <h2>Highscores:</h2>
      <ol>Top players</ol>
    </div>
  );
};

export default Home;
